#include <iostream>
#include <iomanip>
using namespace std;

double toCelsius(double fahrenheit) {
    fahrenheit = (fahrenheit - 32) * 5/9;
}

int main() {
    double F;
    cin >> F;

    if (F >= -100 && F <= 500) {
        toCelsius(F);
        cout << setprecision(2) << fixed << F;
    }

    return 0;
}

#include <iostream>
#include <iomanip>
using namespace std;

double toCelsius(double fahrenheit) {
    fahrenheit = (fahrenheit - 32) * 5/9;
}

int main() {
    double F;
    cin >> F;

    if (F >= -100 && F <= 500) {
        cout << F << << " F is" 
        toCelsius(F);
        cout << setprecision(2) << fixed << F;
    }

    return 0;
}

#include <iostream>
#include <iomanip>
using namespace std;

double toCelsius(double fahrenheit) {
    fahrenheit = (fahrenheit - 32) * 5/9;
    return fahrenheit;
}

int main() {
    double F;
    cin >> F;

    if (F >= -100 && F <= 500) {
        cout << F << " F is" << setprecision(2) << fixed << toCelsius(F) << "C";
    }
    return 0;
}

